import React from 'react'
import PropTypes from 'prop-types'


const User = ({ id }) => {
    return (
    <div>User {id}</div>
    )
}

User.propType = {
    id: PropTypes.number.isRequired
}

User.getInitialProps = async (context) => {
    return { id: parseInt(context.query.id, 10) }
}

export default User
